import React from "react";

const Todo = () => {
  return (
    <>
      <div className="container-fluid">
        <div className="row ">
          <div className="col-xl-4"></div>
          <div className="col-xl-4">
            <div className="card mt-3">
              <div className="card-header"></div>
              <input type="srting " placeholder="What To Do"></input>
              <button className="btn btn-outline bg-primary">Click</button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Todo;
